def MinimumSkew(Genome):
    skew = [0]
    for i in range(len(Genome)):
        if Genome[i] == 'G':
            skew.append(skew[i]+1)
        elif Genome[i] == 'C':
            skew.append(skew[i]-1)
        else:
            skew.append(skew[i])
    minSkew = min(skew)
    return [i for i in range(len(skew)) if skew[i] == minSkew]

